import logo from '../../icons/logo.png'
import styled from 'styled-components'

const LogoContainer = styled.div`
    display: flex;
    font-size: 0px;
`

const LogoImage = styled.img`
    width: 200px;
    height: 15vh;
`

const Logo = () => {
    return(
        <LogoContainer>
            <LogoImage src={logo} alt='logo'/>
        </LogoContainer>
    )
}

export default Logo
